//import ERC721 interface
import "./ERC721.sol";

pragma abicoder v2;
pragma solidity >=0.6.0 <0.8.0;

//implement
contract ArtFundsStorage is ERC721 {
    // this contract's token collection name
    string public collectionName;
    // this contract's token symbol
    string public collectionNameSymbol;

    struct Collection {
        uint256 tokenId;
        string imageURL;
        string name;
        string description;
    }

    uint256 public collectionCounter;
    mapping(address => Collection[]) public ownerCollections;
    // uint256[] collections;

    struct DigitalItem {
        uint256 tokenId;
        uint256 collectionID;
        string name;
        uint256 price;
        string itemURL;
        // address payable mintedBy;
        address payable currentOwner;
        // address payable previousOwner;
        uint256 numberOfTransfers;
        bool forSale;   
    }

    uint256 public digitalItemCounter; 
    mapping(address => DigitalItem[]) public ownerDigitalItems;
    // uint256[] digitalItems;

    event ItemCreated(
        uint256 id,
        uint256 belongByColID,
        string name,
        address mintedBy,
        address currentOwner,
        address previousOwner,
        uint256 price,
        string imageURL,
        uint256 numberOfTransfers,
        bool forSale
    );

    event ItemForSale(uint256 id, bool forSale);

    event CollectionCreated(
        uint256 tokenId,
        string imageURL,
        string name,
        address ownedBy,
        string description
    );

    // initialize contract while deployment with contract's collection name and token
    constructor() ERC721("ArtFunds Collection", "CB") {
        collectionName = name();
        collectionNameSymbol = symbol();
    }

    // mint a new digital item
    function mintDigitalItem(
        uint256 _collectionID,
        string memory _name,
        uint256 _price,
        string memory _itemURL,
        bool _forSale
    ) external {
        // check if thic fucntion caller is not an zero address account
        require(msg.sender != address(0));
        // increment counter
        digitalItemCounter++;
        // check if a token exists with the above token id => incremented counter
        require(!_exists(digitalItemCounter));

        // mint the token
        _mint(msg.sender, digitalItemCounter);
        // set token URL (bind token id with the passed in token URL)
        _setTokenURI(digitalItemCounter, _itemURL);

        DigitalItem memory newDigitalItem = DigitalItem(
            digitalItemCounter,
            _collectionID,
            _name,
            _price,
            _itemURL,
            // _tech,
            // _material,
            // _color,
            // _field,
            // _imageURL,
            // _description,
            msg.sender,
            0,
            _forSale
        );

        ownerDigitalItems[msg.sender].push(newDigitalItem);
    }

    // function updateCurrentOwnerDigitalItem(
    //     address _owner,
    //     address payable _newOwner,
    //     uint256 _tokenId
    // ) public returns (bool success) {
    //     require(_owner != address(0x0));
    //     require(_newOwner != address(0x0));
    //     require(_tokenId >= 0);
    //     DigitalItem memory digitalItem = ownerDigitalItems[_owner][_tokenId];
    //     digitalItem.previousOwner = digitalItem.currentOwner;
    //     digitalItem.currentOwner = _newOwner;
    //     return true;
    // }

    // function updateInfoBasicDigitalItem(
    //     address _owner,
    //     uint256 _tokenId,
    //     string memory _name,
    //     uint256 _price,
    //     string memory _imageURL,
    //     uint256 _numberOfTransfers,
    //     bool _forSale
    // ) public returns (bool success) {
    //     require(_owner != address(0x0));
    //     require(_tokenId >= 0);
    //     require(ownerDigitalItems[_owner].length > 0);
    //     DigitalItem storage digitalItem = ownerDigitalItems[_owner][_tokenId];
    //     digitalItem.imageURL = _imageURL;
    //     digitalItem.name = _name;
    //     digitalItem.price = _price;
    //     digitalItem.forSale = _forSale;
    //     digitalItem.numberOfTransfers = _numberOfTransfers;
    //     return true;
    // }

    function getDigitalItem(uint256 _itemID, address _owner)
        public
        view
        returns (
            uint256 _tokenId,
            uint256 _collectionID,
            string memory _name,
            uint256 _price,
            string memory _itemURL,
            uint256 numberOfTransfers,
            bool _forSale
        )
    {
        require(_owner != address(0x0));
        require(_collectionID >= 0);
        require(ownerDigitalItems[_owner].length > 0);
        DigitalItem memory digitalItem = ownerDigitalItems[_owner][_itemID];

        return (
            digitalItem.tokenId,
            digitalItem.collectionID,
            digitalItem.name,
            digitalItem.price,
            digitalItem.itemURL,
            digitalItem.numberOfTransfers,
            digitalItem.forSale
        );
    }

    function getDigitalItemCount(address _owner)
        public
        view
        returns (uint256 count)
    {
        require(_owner != address(0x0));
        return ownerDigitalItems[_owner].length;
    }

    //This function to create collection from address
    function createCollection(
        string memory _imageURL,
        string memory _name,
        string memory _description
    ) public returns (bool success) {
        collectionCounter++;
        Collection memory collection = Collection(
            collectionCounter,
            _imageURL,
            _name,
            _description
        );
        ownerCollections[msg.sender].push(collection);

        emit CollectionCreated(
            collectionCounter,
            _imageURL,
            _name,
            msg.sender,
            _description
        );
        return true;
    }

    // function getCollections(address _owner)
    //     public
    //     view
    //     returns (Collection[] memory)
    // {
    //     require(_owner != address(0x0));
    //     require(ownerCollections[_owner].length > 0);
    //     return ownerCollections[_owner];
    // }

    function getCollection(uint256 _tokenId, address _owner)
        public
        view
        returns (
            uint256 _id,
            string memory _imageURL,
            string memory _name,
            string memory _description
        )
    {
        // require(_owner != address(0x0));
        // require(_tokenId >= 0);
        // require(ownerCollections[_owner].length > 0);
        Collection memory collection = ownerCollections[_owner][_tokenId];

        return (collection.tokenId, collection.imageURL, collection.name, collection.description);
    }

    // // function updateCollection(
    // //     uint256 _tokenId,
